import React from 'react';
import HomeNavbar from '../components/HomeNavbar';  // Importing the new HomeNavbar

function HomePage() {
  return (
    <div>
      <HomeNavbar />
      <h1 className="text-center text-3xl font-bold mt-10">Welcome to Echoes of History</h1>
      {/* Add more homepage content here */}
    </div>
  );
}

export default HomePage;
